import React from 'react';


const Sresult =(props)=>{
    const img = `https://source.unsplash.com/user/erondu/?${props.name}`;
    console.log(props);
    return (<>
    <div>
        <img src={img} alt="Pic"/>
    </div>
    </>);
}

export default Sresult;
